import React from 'react';
import Spinner from 'react-bootstrap/Spinner';



function Scroll() {
  return (
    <div className="scroll-container">
      <div className="scroll-inner">
        <Spinner animation="grow" variant="primary" />
      </div>

    </div>
  );
}

export default Scroll;
